import React from "react";

function About() {
  return (
    <section id="about">
      <h2>About Me</h2>
      <p>
        I am John Andrei Cabrera, a 3rd year Bachelor of Science in Computer
        Science student who enjoys learning how things work and turning ideas
        into real projects.
      </p>
      <p>
        My interests include web development, algorithms, and software design.
        I like working on small applications that solve real problems and help
        me improve my skills step by step.
      </p>
    </section>
  );
}

export default About;
